import { useState } from "react";

const Home = () => {

    const [name, setName] = useState('mario');
    const [age, setAge] = useState(25);

    const handleClick = () => {
        setName('LUIGI');
        setAge(69);
    }

    return (  
        <div className="home">
            <h2>Homepage</h2>
            <p>{ name } is { age } old</p>
            <button onClick={handleClick}>Click Me</button>
        </div>
    );
}

export default Home;
